import React, { Component } from 'react';
import ComponentF from './ComponentF';
import { UserConsumer } from './UserContext';

class ComponentE extends Component {
    render() {
        return(
            <div>
                <UserConsumer>
                    {
                        username => {
                            return <div>Hello {username}</div>
                        }
                    }
                </UserConsumer>
                <ComponentF />
            </div>
        )
    }
}

export default ComponentE;
